tm.add (
    'test.simple.ExtendFromMultipleObjects',
    ['test.simple.ExtendFromObject', 'test.simple.Object2'],
    function (o, p, d) {
        o.setup = function (config) {
            if (!config.zipCode) { config.zipCode = '85283'; }
            d.zipCode = config.zipCode;
        }

        o.getZipCode = function () {
            return d.zipCode;
        }
    }
);
